    showStar() {
        var abs = this.add.particles('shapes', MyProject);
        abs.x = 340
        abs.y = 200
        abs.setDepth(9)
        // abs.active = 0
        console.log(abs)
        this.tweens.add({
            targets: [abs],
            // active:1,
            // y:600,
            x: -142,
            duration: 1500,
            callbackScope: this,
            onComplete: () => {
                abs.visible = 0
                this.tweens.add({
                    targets: [abs, great, graphics],
                    alpha: 0,
                    duration: 400
                })
            }
        })

        var rect = new Phaser.Geom.Rectangle(0, 300, game.config.width, game.config.height / 4);
        var graphics = this.add.graphics({
            fillStyle: {
                color: 0x000000
            }
        });
        graphics.alpha = 0.5;
        graphics.setDepth(8);
        graphics.fillRectShape(rect);
        var great = this.add.image(256, 400, 'great')
        great.setDepth(9)
        great.alpha = 0
        great.scaleX = 0.3
        great.scaleY = 0.3
        this.tweens.add({
            targets: [great],
            alpha: 1,
            scaleX: 1.3,
            scaleY: 1.3,
            duration: 600,
            callbackScope: this,
            onComplete: () => {
                this.tweens.add({
                    targets: [great],
                    alpha: 1,
                    scaleX: 1,
                    scaleY: 1,
                    duration: 300,
                    callbackScope: this,
                    onComplete: () => {

                    }
                })
            }
        })
    }

